E ela disse " se não quer que te assediem vc tem que se cobrir mais, eu avisei pra não ir com uma roupa colada".
Ela viu que eu estava mal e falou " A culpa não é sua, mas é melhor evitar, vc sabe que sempre vai existir gente assim, então se vc não quer vai ter que começar a fazer isso".

E tudo voltou dnv, eu comecei a chorar e me senti como a Iane de antigamente, a Iane ingénua, burra e dessa vez, sem a proteção de alguém pra dizer que o que ele fez foi horrível .

E agora, eu tô mal pra krlh pq eu tinha uma melhor amiga (uma prima minha) que faz curso cmg e eu vejo ela todo o dia, ela mora na Rua de trás, quase todo dia tá aqui em casa;

Eu e ela brigamos pq eu e ela estávamos brigadas, e eu tava me envolvendo com um cara(conheci ele a três anos) e eu perdi a virgindade com ele, transamos umas três vezes, cada um em um dia, edps de uma semana ele me abandonou, disse que e não dava mais, e que como eu disse "não iria entregar meu coração pra alguém confuso e instável" contei isso pra ela, ela contou pra mãe dela e ela contou pra minha mãe, minha mãe veio falar cmg e acabei brigando com minha mãe tmb;

caso você realmente acredite que não sentiria nada com a morte da sua mãe, fala isso o mais rápido possível para o seu psicológo, por que há 2 possibilidades:
1. Algum trauma pode estar causando um bloqueio emocional em você;
2. Você está perdendo a noção da realidade e não está realmente conseguindo mais imaginar de maneira real como você se sentiria com situações.
